import trash from "../../assets/trash.svg";

export const Card = (transaction, index) => {
  return (
    <>
      <div className="Card-block" key={index}>
        {transaction.transaction.type === "Entrada" ? (<div className="deposit"></div>) : (<div className="out"></div>)}
        <div>
          <h2>{transaction.transaction.description}</h2>
          <span>{transaction.transaction.type}</span>
        </div>
        <div>
          <span>{transaction.transaction.value}</span>
          <img src={trash} alt="lixeira" />
        </div>
      </div>
    </>
  );
};
